<script>var __DATABRICKS_NOTEBOOK_MODEL = {"version":"NotebookV1","origId":1534055944058895,"name":"VariantSpark_HipsterIndex_Spark2","language":"scala","commands":[{"version":"CommandV1","origId":1534055944058896,"guid":"74745f45-5c1f-4cb8-83b0-fed1a83be752","subtype":"command","commandType":"auto","position":2.0,"command":"%md\n![VariantSpark](https://s3.us-east-2.amazonaws.com/csiro-graphics/variant-spark.png)  \n* [**VariantSpark**](http://bioinformatics.csiro.au/variantspark) is a machine learning library for real-time genomic data analysis (for thousands of samples and millions of variants) and is...  \n  * Built on top of Apache Spark and written in Scala\n  * Authored by the team at [CSIRO Bioinformatics](http://bioinformatics.csiro.au/) in Australia\n  * Uses a custom machine learning **random forest** implementation to find the most *important* variants attributing to a phenotype of interest   \n* This demo...  \n  * Includes a dataset with a subset of the samples and variants (in VCF format) from the 1000 Genomes Project  \n  * Uses a synthetic phenotype called *HipsterIndex* (in CSV format) factoring various real phenotypes (monobrow, beard, etc.)","commandVersion":1,"state":"finished","results":null,"errorSummary":null,"error":null,"workflows":[],"startTime":0,"submitTime":1511368025722,"finishTime":0,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"streamStates":{},"nuid":"2ded4953-ea6e-40bb-b6a2-6423e9b4509a"},{"version":"CommandV1","origId":1534055944058897,"guid":"64357809-8e9f-465b-a6f5-e4784cf98d72","subtype":"command","commandType":"auto","position":3.0,"command":"%md\n## HipsterIndex\nThe synthetic HipsterIndex was created using the following genotypes and formular:\n\n| ID |SNP ID     | chromosome | position | phenotype | reference |\n|---:|----------:|----:|-------:|-----:|----------:|------:|\n| B6 |[rs2218065](https://www.ncbi.nlm.nih.gov/projects/SNP/snp_ref.cgi?rs=2218065) | chr2 | 223034082 | monobrow | [Adhikari K, et al. (2016) Nat Commun.](https://www.ncbi.nlm.nih.gov/pubmed/?term=26926045) |\n| R1 |[rs1363387](https://www.ncbi.nlm.nih.gov/projects/SNP/snp_ref.cgi?rs=1363387) | chr5 | 126626044 | Retina horizontal cells (checks) | [Kay, JN et al. (2012) Nature](https://www.ncbi.nlm.nih.gov/pubmed/?term=22407321)\n| B2 |[rs4864809](https://www.ncbi.nlm.nih.gov/projects/SNP/snp_ref.cgi?rs=4864809) | chr4 |  54511913 | beard | [Adhikari K, et al. (2016) Nat Commun.](https://www.ncbi.nlm.nih.gov/pubmed/?term=26926045)\n| C2 |[rs4410790](https://www.ncbi.nlm.nih.gov/projects/SNP/snp_ref.cgi?rs=4410790)  |chr7 |17284577| coffee consumption        | [Cornelis MC et al. (2011) PLoS Genet.](https://www.ncbi.nlm.nih.gov/pubmed/?term=21490707) |\n\n`HipsterIndex = ((2 + GT[B6]) * (1.5 + GT[R1])) + ((0.5 + GT[C2]) * (1 + GT[B2]))`\n\n  GT stands for the genotype at this location with *homozygote* reference encoded as 0, *heterozygote* as 1 and *homozygote alternative* as 2. We then label individuals with a HipsterIndex score above 10 as hipsters, and the rest non-hipsters. By doing so, we created a binary annotation for the individuals in the 1000 Genome Project.\n\nIn the rest of this notebook, we will demonstrate the usage of VariantSpark to reverse-engineer the association of the selected SNPs to the phenotype of insterest (i.e. being a hipster).","commandVersion":1,"state":"finished","results":null,"errorSummary":null,"error":null,"workflows":[],"startTime":0,"submitTime":1511368025975,"finishTime":0,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"streamStates":{},"nuid":"ec1fdbf0-d30b-4c5f-93b9-39434b05bbb4"},{"version":"CommandV1","origId":1534055944058898,"guid":"b269979e-1d9d-4111-bbd9-0a79a9d05d91","subtype":"command","commandType":"auto","position":4.0,"command":"%md\n###0. SETUP -- Databricks Spark cluster and VariantSpark:  \n\n1. **Import** the variant-spark libary into your Databricks instance by...  \n  - Navigate to `Workspace > Users > Username` and select `Create > Library`    \n  - Click on `maven coordinates` in the source list in the 'Create Library' page\n  - Enter `au.csiro.aehrc.variant-spark:variant-spark_2.11:0.0.2-SNAPSHOT` in the coordinate text box\n  - Click `advanced` and enter `https://oss.sonatype.org/content/repositories/snapshots` in repository text box\n  - Click the `create library` button\n  - Verify that the option `automatically attach to all clusters` is checked in the libraries page\n2. **Create** a cluster by...  \n  - Click the `Clusters` icon on the left sidebar and then `Create Cluster.` \n  - Enter any text, i.e `demo` into the cluster name text box\n  - Select the `Apache Spark Version` value `Spark 2.1 (auto-updating scala 2.11)`  \n  - Click the `create cluster` button and wait for your cluster to be provisioned\n3. **Attach** this notebook to your cluster by...   \n  - Click on your cluster name in menu `Detached` at the top left of this workbook to attach it to this workbook ","commandVersion":1,"state":"finished","results":null,"errorSummary":null,"error":null,"workflows":[],"startTime":0,"submitTime":1511368026263,"finishTime":0,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","hei howCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"streamStates":{},"nuid":"ddc475fa-c55d-4d91-a1b5-8f776dbc0bde"},{"version":"CommandV1","origId":1534055944058909,"guid":"b6bc2731-9fe9-447d-b8cf-8404f9aa3cf6","subtype":"command","commandType":"auto","position":15.0,"command":"%md\n##Variant Importance Score\nVariantSpark assigns an \"Importance\" score to each tested variant reflecting it's association to the phenotype of interest. The Importance score is calculated based on the [Gini Impurity](https://en.wikipedia.org/wiki/Decision_tree_learning#Gini_impurity) scores of the decision trees in the random forest built by VariantSpark. In the decision tree building process, at each tree node, VariantSpark uses variants from the VCF dataset to split the samples and calculate the Gini Impurity scores before and after the split. At a given node _N_, the decrease in the Gini Impurity score by splitting using a feature _p_ is defined as \n$$\n\\Delta I = I(N) - (I(L) + I(R)),\n$$ \nwhere _I(N)_ is the Gini Impurity at node _N_, and _I(L)_ and _I(R)_ are the Gini Impurity scores of the left and right child node, respectively. Then, the Importance score of variant _p_ is defined as the mean of the decrease in Gini Impurity score by splitting using the variant _p_ across all nodes and trees in the random forest. A variant with __higher Importance score implies it is more strongly associated with the phenotype of interest__.","commandVersion":1,"state":"finished","results":null,"errorSummary":null,"error":null,"workflows":[],"startTime":0,"submitTime":1510948714587,"finishTime":0,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","s
